import React from "react";
import Alert from "../../Shared/Alert";

function Main({ children }) {
	return (
		<main
		// className="h-full w-full"
		>
			<div
			// className="container grid  mx-auto"
			>
				<Alert />
				{children}
			</div>
		</main>
	);
}

export default Main;
